description:
Hoffmaestro &amp; Chraa is a swedish ska music group. Their greatest influences are Funkadelic, Manu Chao, Dr. John, Guns N' Roses, David Ruffin and Beastie Boys.
They have, among other acts, played on the swedish festivals Peace &amp; Love, Arvikafestivalen, Siesta! och Putte i parken 2009.



